import logo from './imgs/VoterAppQR.png';

function Extras() {
    return<>



    <div class="extras">

    <div>
        <div>Voter Helpline Number</div>
        <img src={logo} style={{width:120,height:120}}></img>

        <div> Download Voter Helpline
              with Given QR
        </div>
    </div>

    </div>
        </>
}

export default Extras;
